import React, { Component } from 'react'
import { withRouter } from 'react-router-dom';

 class Products extends Component {

    goToDetails = (product) =>{
         this.props.history.push('./Product/${product}')
    }
  render() {
    return (
      <center>
        <ul>
          <li onClick={() => goToDetails("iPhone")}>iPhone</li>
          <li onClick={() => goToDetails("iPad")}>iPad</li>
          <li onClick={() => goToDetails("iWatch")}>iWatch</li>
          <li onClick={() => goToDetails("iMac")}>iMac</li>
        </ul>
      </center>
    );
  }
}
export default withRouter(Products)
